import React from 'react'
import Axios from 'axios'

const Generos = () => {
    const [data, setData] = React.useState([])
    React.useEffect(() => {
        axios
            .get('generos')
            .then(res => {
                setData(res.data)
            })
    })
    return <h1>Generos</h1>
}

export default Generos
